/** @format */

import React from "react";

class MovieList extends React.Component {
  constructor(props) {
    super(props);
    console.log(props);
  }

  render() {
    return (
      <div>
        {this.props.movies[0].map(
          ({ original_title, overview, popularity }) => (
            <ul>
              <li>{original_title}</li>
              <li>{overview}</li>
              <li>{popularity}</li>
            </ul>
          )
        )}
      </div>
    );
  }
}

export default MovieList;
